import React, { Component } from 'react';
import Slider from '@material-ui/lab/Slider';
import AppBar from '@material-ui/core/AppBar';

class PersonsCount extends Component {
    state = {
        x:0,
    }
    handleChange =()=>{
        this.setState({
            x: this.state+1
        })
    }

    render() {
        return <Slider
        min="60"   
        max="100"

        />
    }
}

export default PersonsCount;
